description:
Sweetheart proudly presents Performer of the year Remy La Croix in her very own volume of the popular &quot;loves girls&quot; series. In the tradition of this title, Remy has chosen four of her favorite girls in the industry some whom she has worked with, and others she has admired from afar. Watch Remy demonstrate her skills with a hula hoop, listen to her talk about her love of women and see her make mad, passionate love to four gorgeous girls. It will be very clear how much Remy Loves Girls.

